function ProgressBar({progress}) {
  const colors = [
    'teal',
    'rgb(120,120,120)'
  ]

  const randomColor = colors[Math.floor(Math.random() % colors.length)];

  return (
    <div className="outer-bar">
      <div 
      className="inner-bar"
      style={{width: `${progress}%`, backgroundColor: randomColor}}
      ></div>
    </div>
  );
}

export default ProgressBar;
